import React, { useEffect, useState } from "react";
import { api } from "./api";

export default function CalendarView({ token, projectId }) {
  const [events,setEvents]=useState([]);
  useEffect(()=>{ api(`/events?project_id=${projectId}`,{token}).then(setEvents); },[projectId]);
  return (
    <div>
      <h3>프로젝트 {projectId} 일정</h3>
      <ul>
        {events.map(ev=>
          <li key={ev.id}>
            {ev.title} ({ev.start_date} ~ {ev.end_date})
          </li>
        )}
      </ul>
    </div>
  );
}
